import { StyleSheet } from "react-native";

const style = StyleSheet.create({
    viewFooter: {
        width: '100%',
        height: '15%',
        backgroundColor: '#212529',
        justifyContent: 'center',
        alignItems: 'center',
        
    },

    text: {
        color: '#fff',
        fontSize: 16
    }
})

export default style;
